import React, { Component } from "react";
import Project from "./components/projects";
import NewProject from "./components/newProject";
import "./App.css";
import Paper from "@material-ui/core/Paper/Paper";
import axios from "axios";

class App extends Component {
  constructor() {
    super();
    this.state = {
      projectList: []
    };
  }

  componentDidMount() {
    axios.defaults.baseURL = "https://randomuser.me/api"; // GHANGE FOR REAL API

    axios
      .get("/?results=5")
      .then(response => {
        console.log(response.data.results);
        this.setState({ projectList: response.data.results });
      })
      .catch(err => {
        console.log(err);
      });
  }

  handleAddProject = projectName => {
    this.state.projectList.push(projectName);
    console.log("Projectlist: " + this.state.projectList);
  };

  render() {
    return (
      <Paper className="App" elevation={10}>
        <NewProject onAddProject={this.handleAddProject} />
        <Project projectList={this.state.projectList} />
      </Paper>
    );
  }
}

export default App;
